import React, { Component } from "react";

export default class HomePage extends Component {
  render() {
    return (
      <div className="home-wrapper">
        <perfect-scrollbar className="vh-100">
          <div style={{ position: "static" }}></div>
        </perfect-scrollbar>
      </div>
    );
  }
}
